// Take in old state of data store collaborate with action and perform a new state of data 


const initialState = {
    isWaiting: false,
    memories : [
        {id: 3, year: 2020, month: 4, day:7, message: "Still..."},
        {id: 2, year: 2021, month: 4, day:7, message: "Still..."},
        {id: 1, year: 2022, month: 4, day:7, message: "Still..."},
      ]
};

function reducer(state = initialState, action){
    return state;
}

export default reducer;
